        "activities": "Yoga",
        "alias": "restorative",
        "description": "Restorative yoga takes a gentle, healing approach to releasing deep layers of tension throughout the body. We'll use blocks, bolsters and blankets to support and ground postures which are held for approximately ten minutes. Dim lighting and soft music creates a peaceful atmosphere your mind & body will thank you for.\n \nThis class is open to all levels and perfectly suited for anyone recovering from injury, illness, or simply feeling overwhelmed.\n\nA 16-student limit in this class provides the opportunity for extra restoration.\n \n65 minutes",
