        "alias": "dance-for-pd-pro",
        "description": "Modeled after the award-winning Dance for PD® program, Dance for PD® PRO classes integrate elements of ballet, modern and tap technique to help people with Parkinson's build and master a specific set of dance skills through a focused, intensive approach. Dance for PD® PRO is a class designed for the working professional or those who seek a level of mastery, comprehension, and focus through a more rigorous dance experience. To provide a comprehensive learning experience, master Dance for PD® teachers, will combine accelerated physical and cognitive training, technique, improvisation and a focus on structural alignment in an intimate, friendly, personalized workshop environment. The 60-minute class, which features live music, will include a progressive standing warm up, standing barre work and traveling steps. For more information about Dance for PD, please visit www.danceforpd.org or call (800) 957-1046.",
