        "alias": "slow-flow-and-yoga-nidra",
        "description": "Their Slow Flow classes follow a slower, more mellow pace and include Restorative and Yin yoga postures. These classes are suitable for all levels.\n\nYoga nidra is a guided meditation technique practiced in savasana. It's based on the tantric technique called nyasa - which aims to make every single cell in the body conscious. Through the practice of yoga nidra you bring yourself into a hypnogogic state - a state in between being awake and being asleep. In this state - and through the different stages of guided meditation - you have more access to your subtle bodies and subconscious and unconscious mind. Yoga nidra promotes deep relaxation - relieving physical stress and tension, as well as emotional, mental and energetic stress.",
