        "alias": "mama-bear-yoga-mommy-and-me-style",
        "description": "MamaBear Yoga is a one hour “mommy-and –me-style” yoga class for moms and their new babies, newborn through pre-crawl. Doors open at 2:00pm to settle in for a 2:15 class start. Mats, blocks, bolsters and blankets are all supplied. An excellent way to stretch, strengthen, and tone your body after birth. No previous yoga experience is necessary. The babies love the experience, being together, watching mommy, and love the special way they are incorporated into the yoga poses. You get a wonderful workout with BabyBear, and they will enjoy the special music and baby movement segments. “Baby Whisperer”Alex Venier, our MamaBear Yoga Teacher is a magic spinner. Always adapting the group to various needs, Alex leads a class that is equally physically challenging and attentive to your postpartum restorative support. From weaving a dynamic class with hoots and hollers from the wee ones, to casting a spell of baby calm, Alex can juggle the energies while juggling a baby. A great way to meet other local new moms and get back in shape.",
