        "alias": "adult-beginner-ballet-rpip",
        "description": "Adult Beginning Ballet is a classical ballet class and no experience is necessary.\n     The first half of class takes place standing at a ballet barre. This helps you with your with balance so you can focus on your posture, alignment and coordination. The teacher explains and demonstrates each exercise without the music first. This gives you a chance to learn the exercise. Then the teacher does the exercise with the class and with the music. This helps coordinate the exercises with the music.\n      For the second half of class, the barres are moved to the side of the room and you learn a set of movements called a combination. Each movement is thoroughly explained. Then you practice the combination, over and over, until you feel comfortable and confident with all the steps. \n     If you have taken ballet before, even 10-20 years ago, you will be surprised at the how much you remember. If you have not taken ballet before, feel free to follow the teacher or other students.\n     We want you to enjoy dancing to the music. There is no right or wrong. We just want you to come and enjoy moving.\n     What to wear and what to bring: No sneakers. You can wear socks or ballet slippers. You can",
