        "alias": "yoga-for-athletes-16bc80a1e63",
        "description": "Developed by an athlete for athletes, this class is designed to improve performance and help prevent injuries. With a focus on intelligent, functional strength and mobility that mirrors the biomechanics of endurance sports, we add external weights to simple yoga postures and sequences to help beginner and experienced athletes maintain and increase joint and muscle loading. Classes also include soft-tissue release techniques, breathing exercises and meditation to help athletes down-regulate the nervous system for maximum recovery. Taught by a NYS-licensed massage therapist and 500+ hour-trained therapeutic yoga teacher. This class will not be heated.",
