        "reservation_id": 33909953,
        "review": "Signed up thinking that this was the same as jumpboard. (Pilates novice here). I was a little worried I'd hate it since I'm not a fan of the floor. It had elements of a reformer style class which was a pleasant surprise. Alaina was fantastic. Great energy and instruction. Small class with personal attention. I got a very good weight/ muscle training workout. ",
