        "alias": "strength-and-contrology-r3lv",
        "description": "S&C is a signature class only taught by studio founders Cadence and Manuel. Bring your fitness to a creative new level with complex body weight, mobility and challenging core movement. We use the floor, props and kettlebells to create strong muscles, body awareness, flexibility and proper alignment. It’s a tough workout but open to all. Those with shoulder and wrist injuries may want to try a CTP or Start Pilates classes until they are ready to bear weight on hands and engage in overhead shoulder movement.\nBrooklyn Strength is a community based inclusive studio welcoming to all bodies and fitness abilities. If you are feeling shy, feel free to reach out to our main Desk via our website brooklynstrength.com or via social media @bkstrength with any questions or concerns.\n\n***Buzz # 3 for entry. Please do not arrive more than 15 minutes before class time.***",
