        "alias": "pole-for-beginners-introductory-level",
        "description": "Welcome to Introductory to Pole Dance, Start here if you have little to no experience or getting back into pole. This pole dance foundation class emphasizes 3 basic pole fitness concepts to ensure safe and strong pole journey ahead: 1. How to work the core central muscle groups necessary for pole fitness through simple exercises. Ex: baseball grips, knee tuck ups, and fan kicks. 2. Develop the proprioception of your body limbs necessary for pole fitness tricks. Ex: Pirouette turn to climb to invert. 3. Through repetition and drilling the foundational pole movements students will develop the muscle memory and coordination necessary. Throughout the class, students will learn basic terminology to name movements. *Shorts are required so your skin will grip the pole* *Absolutely NO jewelry because it will tear your skin, dent your jewelry, and risk get tangled*",
