        "alias": "beginner-modern",
        "description": "This class is a highly imaginative and highly physical investigation of yourself as a mover. Class begins with a sensation-based warm up where you ground yourself through improvisation and set material. Then you will learn some basics of modern technique and cultivate skills, strength and curiosity through floor, standing exercises and across the floor sequences. Class culminates in a full bodied athletic dance phrase that challenges you physically and creatively as a dance artist. Suitable for the absolute beginner to dance and/or modern dance, this class is open to all interested in moving.",
