    "activities": "",
    "description": "They are one of the East Coast's largest premier floatation therapy centers. They offer five state of the art sensory deprivation tanks, each in its own private suite with shower. Their tanks are filled with approximately 250 gallons of water and 1000 pounds of Epsom salt, allowing you to float effortlessly. The water is heated to skin temperature, and the tanks are lightproof and soundproof inside. With most sensory inputs eliminated and your body freed from gravity, you can easily experience deep relaxation. \r\nLift / Next Level Floats is a premier ClassPass Wellness venue. See their class descriptions for more information on the services they provide. ",
