        "rating_id": 43718908,
        "reservation_id": 70813412,
        "review": "The staff here is so lovely and I loved the float room. You can turn all the lights off to get the same sensory deprivation experience as you can in the pod. The room doesn’t have music, which I preferred (though apparently you can turn it off in the pod too). Left feeling so refreshed and deeply relaxed.",
