        "activities": "",
        "alias": "led-therapy-16abb5f4257",
        "description": "This session includes a thorough cleanse and treatment mask under the LED panel for 20 mins. A skin rejuvenating facial relaxation therapy. While you relax your skin repairs, restores and oxygenates. You will see a clearer complexion that gives your skin a natural glow. In order to see the maximum benefit we recommend a series of 6 weekly sessions. \n\nWhat are the skin benefits of LED (light emitting diodes)?\nJust as plants absorb and convert sunlight into cellular building blocks, skin absorbs therapeutic light and uses it as a source of energy to stimulate cellular regeneration to produce collagen and elastin, kill p. acnes bacteria, reduce inflammation and speed healing. LED has been shown to minimize fine lines and wrinkles, shrink pore size, reduce inflammation and increase circulation and oxygenation of the skin. Greater oxygenation leads to increased nutrients to areas of the skin responsible for cell growth.",
