    "images": "https://res.cloudinary.com/classpass/image/upload/f_auto,q_auto/glo0q6ecnvam6gcfofy5.png",
    "activities": "Massage, Acupuncture",
    "description": "True North Acupuncture is a clean, modern wellness center in the heart of the Financial District offering acupuncture, massage therapy and other Eastern Medicine healing practices. True North is owned and operated by two highly professional women with a broad range of knowledge and experience in holistic healthcare. Patients can expect extensive one-on-one time with a practitioner as well as an individualized treatment based on the patients own needs and preferences.\r\n\r\n**Acupuncture is a form of alternative medicine in which thin needles are inserted into the body. Acupuncture may help ease types of pain that are often chronic such as low-back pain, neck pain, and osteoarthritis/knee pain. It also may help reduce the frequency of tension headaches and prevent migraine headaches.\r\n\r\n**Cupping therapy is a form of alternative medicine in which a therapist puts special cups on the skin for a few minutes to create suction. Cupping therapy helps with pain, inflammation, blood flow, relaxation and well-being.\r\n",
