        "rating_id": 35866859,
        "reservation_id": 56954453,
        "review": "It was a great class but you need to think about how serious you are about leaning Krav Maga before you go. The instructor Mark was super nice and great at inspiring people. The class was relatively small so you could get enough attention. However it is more like a trail on ClassPass. If you are like me who likes to do various workout every month, Krav Maga might not be a good one to add to your routine. The class is not really for beginners, so in order to keep up with the rest you kind of have to sign up for the membership. I read the negative reviews about the promoters before I went, but luckily the one calling me was very polite. But if you only go once or twice a month using classpass, you will not get enough trainings. But try it out, you might be intrigued and sign up for the membership. Who knows :)",
